/** @format */

import React from 'react';

export default function Banner() {
  return (
    <div className='mt-12 w-screen h-72 bg-red-400 text-2xl'>
      <p>파란색으로도 보이고</p>
      <p>녹색으로도 보이는 그 옷처럼,</p>
      <p>미결과 영원 사이에서 사무치도록</p>
    </div>
  );
}
